import React from "react";
import HeroSection from "../components/HeroSection";

function LandingPage() {
  return (
    <div>
      <HeroSection />
      <h1>Welcome to StampNet</h1>
      <p>Start timestamping your documents securely!</p>
    </div>
  );
}

export default LandingPage;
